// defs for quick peek

void c_vector3d::Clamp() {
	clamp(x, -89.0f, 89.0f);
	clamp(y, -180.0f, 180.0f);
	z = 0.0f;
}
void c_vector3d::Normalize() {
	while (x > 180.f)
		x -= 360.f;

	while (x < -180.f)
		x += 360.f;

	while (y > 180.f)
		y -= 360.f;

	while (y < -180.f)
		y += 360.f;
}
void c_vector3d::Sanitize() {
	//safety
	if (!isfinite(x) || isnan(x) || isinf(x))
		x = 0.0f;

	if (!isfinite(y) || isnan(y) || isinf(y))
		y = 0.0f;

	//normalize
	Normalize();

	//clamp
	Clamp();
}
